import React from "react" 
import styled from 'styled-components';
import axios from "axios";
import { LoginContext } from "../Contexts/LoginComponent";
import { useNavigate } from 'react-router-dom';

export default function Despesas() {
    const {setToken,token,name} = React.useContext(LoginContext);
    const [listaDespesas, setListaDespesas] = React.useState([]);
    const navigate = useNavigate();

    React.useEffect(() => {
        const config = {
            headers: { token:token }
        };
        const req = axios.get('http://localhost:5000/despesas',config);
        req.then(su);
        function su(resp){ 
            setListaDespesas([...resp.data]);
            console.log(listaDespesas);
        }
        req.catch(er);  
        function er(){
            alert("Deu erro");
        }  
	}, []);

    function exit(){
        setToken("");
        navigate('/');
    }

    return (
        <Container>
            <div className="nome">
                <h2>Olá, {name}</h2>
                <ion-icon name="exit-outline" onClick={exit} ></ion-icon>
            </div>
            <div className="despesas">
                <p>Não há registros de entradas ou saídas</p>
            </div>
            <div className="buttonContainer">
                <div className="button" onClick={()=>navigate('/entrada')}>
                    <ion-icon name="add-circle-outline"></ion-icon>
                    <p>Nova</p>
                    <p>entrada</p>
                </div>
                <div className="button" onClick={()=>navigate('/saida')}>
                    <ion-icon name="remove-circle-outline"></ion-icon>
                    <p>Nova</p>
                    <p>saída</p>
                </div>
            </div>
        </Container>
    )
}

const Container = styled.div`
min-height: 100vh;
width:100%;
padding-top:25px;
padding-bottom:15px;
display:flex;
flex-direction:column;
align-items:center;
.nome{
    width: 326px;
    //margin-bottom:20px;
    display:flex;
    justify-content:space-between;
}
h2{
    font-style: normal;
    font-weight: 700;
    font-size: 26px;
    line-height: 31px;
    color: #FFFFFF;
}
