    font-size: 20px;
    line-height: 23px;
    text-align: center;
    color: #868686;
    margin:200px 73px;
}

.buttonContainer{
    padding-top:10px;
    width: 326px;
    display:flex;
    flex-direction:row;
    justify-content: space-between;
}

.button{
    position: relative;
    width: 156px;
